import Topbar from "./components/topbar/Topbar";
import Homepage from "./pages/homepage/Homepage";
import { Routes ,Route } from 'react-router-dom';

function App() {
  const currentUser = true;
  return (
    <div className="App">
      <div className="content">
        <Routes>
          <Route path="/" element={<Homepage />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
